Yes you're not reading that mixin right. Once a level is made, it'll immediately make its own LevelDataManager (which it also ticks) with the name `<namespace>_<path>`. AE2 computeIfAbsents on the same `<namespace>_<path>`, but its not absent so it wont compute AE2's thing (so no SpatialStorageWorldData). If anything it's an unsafe generic type cast in Minecraft code
```java
public <T> T computeIfAbsent(String key, Supplier<T> producer) {
    Object thing = this.get(key);

    if (thing != null) {
        return (T) thing; // unsafe
    } else {
        T thing = producer.get();
        this.put(key, thing);
        return thing;
    }
}
```

The only reasonable quick fix is if someone stops using the same ID. IMO AE2 is well within its rights to reserve `ae2_spatial_storage` so that other mod should use something else, perhaps with a prefix. Would also need an upgrade path for them.
